@matin_dore Bonjour @matin_dore, nous comprenons votre mécontentement et souhaitons vous aider. Pouvez-vous nous envoyer un DM détaillé de votre demande s'il vous plait ? 
Merci à vous. 
Sandrine

@juliencallede Bonjour  @juliencallede, pouvez-vous nous envoyer un DM détaillé de votre demande s'il vous plait ? 
Merci à vous. 
Sandrine

@AbdixE Hello @AbdixE , we understand your annoyance. We will come back to you in DM to inform you on the progress of the regularisation of your request. 
Thank you for your understanding. 
Good day, Yvonne

@AyaGuetta Bonsoir @AyaGuetta, pouvez-vous nous envoyer un DM détaillé de la demande en cours s'il vous plait ? 
Merci et bonne soirée, 
Sandrine

@ThiboCF Bonsoir @ThiboCF, notre site https://t.co/trLJMrwkLP vous permettra d'obtenir les infos nécessaires à la préparation de votre voyage. 
Nous vous souhaitons une bonne soirée, 
Sandrine

@havanatomy Bonjour @havanatomy, nous vous invitons à relancer votre demande en DM afin qu'un conseiller revienne vers vous dès que possible. 
Nous vous prions de nous excuser pour ces délais de traitement. 
Sandrine

@emiliectre_SAV Bonjour @emiliectre_SAV, toutes les infos concernant les modalités de voyage sont à retrouver par ici ➡https://t.co/itYFOCIuQ1
Bon voyage!
Sandrine

@Sophfle Bonjour  @Sophfle, pouvez-vous nous indiquer sur quel navigateur vous vous êtes connectée s'il vous plait ? 
Merci. 
Sandrine

@psykobuzzz1 Bonjour @psykobuzzz1, pouvez-vous nous envoyer un DM avec les détails de la réservation concernée s'il vous plait ? 
Nous vous remercions. 
Sandrine

@sad4mor Bonjour @sad4mor, pouvez-vous nous envoyer un DM détaillé de votre réservation de voyage afin qu'un conseiller vous assiste s'il vous plait ? 
Nous vous remercions. 
Sandrine

@curvedway Bonjour @curvedway, votre demande est bien pris en compte par nos conseillers qui reviendront dès que possible avant votre départ. 
Merci de votre compréhension. 
Bonne fin de journée, Sandrine

@thomasaunier Bonjour @thomasaunier, nous sommes sincèrement navrés pour ces délais. Nos conseillers sont également disponibles en DM pour vous assister dès que possible. 
Merci pour votre compréhension. 
Sandrine

@manishvoswal Hi @manishvoswal, we are sorry to hear about this delay. You can make a claim by following this link➡ https://t.co/rIZRhyT2aJ. 
We remain at your disposal. 
Sandrine

@greetrahil Hi @greetrahil, can you DM us you travel informations in order to be assisted properly on this request ? 
Thank you. 
Sandrine

@bedoui_haifa Bonjour @bedoui_haifa, compte tenu de votre demande et suite à l'envoi de votre DM, nous avons demandé une prise en charge prioritaire de votre dossier. 
Nous vous prions de nous excuser pour ces délais de traitement. 
Sandrine

@bang_tam Bonjour  @bang_tam, nous vous confirmons qu'en plus de votre schéma vaccinal complet, vous devez présenter un  test PCR ou Antigénique de &lt; 1 jour. 
Bonne fin de journée, 
Sandrine

@BiloudeNice Bon voyage @BiloudeNice ✈
Merci pour ce cliché !
Sandrine
